import React from 'react'
import { Link } from 'react-router-dom'

const Home = () => {
  return (
    <>
    <div>
    <Link to='/login'><Button variant="primary">Login</Button>{' '}</Link>
    <Link to='singup'><Button variant="primary">Sing up</Button>{' '}</Link>
    </div>
    </>
  )
}

export default Home
